import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { HttpClientModule } from '@angular/common/http'; // ✅ AJOUTER CECI

import { AdminContenerComponent } from './components/admin/admin-contener/admin-contener.component';
import { NotFoundComponent } from './not-found/not-found.component';
import { UtilisateurModule } from './components/utlisateur/utilisateur.module';
import { AdminModule } from './components/admin/admin.module';

@NgModule({
  declarations: [
    AppComponent,

    AdminContenerComponent,
    NotFoundComponent,
    // autres composants
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    HttpClientModule,
    UtilisateurModule,
    AdminModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
